import Header from "./component-UI/header";

function App() {
  return (
    <div
      className="App"
      style={{
        minHeight: "100vh",
        background: "linear-gradient(135deg, #0f2027 0%, #2c5364 100%)",
        color: "#b3cfff",
        fontFamily: "'Orbitron', 'Segoe UI', Arial, sans-serif",
        letterSpacing: "0.05em",
        padding: 0,
        margin: 0,
      }}
    >
      <Header />
    </div>
  );
}

export default App;
